import React, { Component } from 'react';
class TinTuc extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: ""
    };
  }
  async componentDidMount() {
    //const response = await fetch('server-spring-boot-api.herokuapp.com/api/CheckKey111');
    fetch("server-spring-boot-api.herokuapp.com/api/CheckKey")
      .then(res => res.text())
      .then(
        (result) => {
          var parser = new DOMParser();
          var doc = parser.parseFromString(result, "text/html");
          console.log(doc);
          //var docArticle = doc.querySelector('pre').innerHTML;
          //alert(docArticle);
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          alert(error);
        }
      )

  }


  render() {

    return (
      <div>{this.state.items}</div>
    )
  }
}
export default TinTuc;
